import React, { Component } from 'react';
import { Feed, Icon } from 'semantic-ui-react';



class FamilyExampleImageLabelShorthand extends Component {
    render() {
        return (
            
  <Feed>
    <Feed.Event
      image='/images/avatar/small/elliot.jpg'
      content='You added Elliot Fu to the group Coworkers'
    />
    <Feed.Event>
      <Feed.Label image='/images/avatar/small/elliot.jpg' />
      <Feed.Content content='You added Elliot Fu to the group Coworkers' />
    </Feed.Event>
  </Feed>
)




            
        








    }
}


export default FamilyExampleImageLabelShorthand;
